Here is an implementation of the Pollard's rho algorithm for integer factorization in Python:

```python
import random
import math

def multiplicative_inverse(e, phi):
    def extended_gcd(a, b):
        if a == 0:
            return (b, 0, 1)
        else:
            gcd, x, y = extended_gcd(b % a, a)
            return (gcd, y - (b // a) * x, x)

    gcd, x, _ = extended_gcd(e, phi)
    return x % phi


def pollard_rho(n):
    if n % 2 == 0:
        return 2

    x = random.randint(1, n - 1)
    y = x
    c = random.randint(1, n - 1)
    g = 1

    while g == 1:
        x = ((x ** 2) % n + c + n) % n
        y = ((y ** 2) % n + c + n) % n
        y = ((y ** 2) % n + c + n) % n
        g = math.gcd(abs(x - y), n)

    if g == n:
        return None
    else:
        return g


def full_factorize(n):
    factors = []
    while n > 1:
        p = pollard_rho(n)
        if p is None:
            break
        cnt = 0
        while n % p == 0:
            cnt += 1
            n //= p
        factors.append((p, cnt))
    if n > 1:
        factors.append((n, 1))
    return factors


# Example usage:
num_to_factorize = 1234567890123456789
factors = full_factorize(num_to_factorize)
print("Factors:")
for (factor, count) in factors:
    print(f"{factor}^{count}")
```

This code uses the `pollard_rho` function to find a non-trivial factor `p` of the input number `n`. It then uses this factor to repeatedly divide `n` until `p` no longer divides `n`, incrementing a counter `cnt` each time. The pair `(p, cnt)` is added to the list of factors.

The `full_factorize` function continues this process until `n` is fully factored, at which point it returns the list of factors. If the `pollard_rho` function fails to find a factor (i.e., it returns `None`), the `full_factorize` function simply stops and returns the current list of factors.

Please note that the Pollard's rho algorithm may take a very long time or even fail to find a factor for certain numbers, especially large ones. This is because the algorithm relies on randomness and has a limited probability of succeeding. For such cases, you might want to consider using a more robust and deterministic factoring algorithm like the General Number Field Sieve (GNFS).

