Here is a simple function in C++ that calculates the surface area of a cube:
```
#include<iostream>
using namespace std;

double cubeSurfaceArea(double side) {
    if (side <= 0) {
        throw invalid_argument("Side length must be a positive value");
    }
    return 6 * side * side;
}

int main() {
    double sideLength;
    cout << "Enter the side length of the cube: ";
    cin >> sideLength;

    try {
        double area = cubeSurfaceArea(sideLength);
        cout << "The surface area of the cube is: " << area << endl;
    } catch (const invalid_argument& ia) {
        cerr << "Error: " << ia.what() << endl;
        return 1;
    }

    return 0;
}
```
This program prompts the user to enter the side length of the cube, and then it calls the `cubeSurfaceArea` function with the entered value. The function checks if the side length is valid (i.e., positive), and if so, it returns the calculated surface area using the formula `6 * side^2`. If the side length is not valid, it throws an `invalid_argument` exception.

In the `main` function, the program catches any exceptions thrown by the `cubeSurfaceArea` function and prints an error message if one occurs.

In C++, `std::floor()` is a function from the `<cmath>` library that returns the largest integer less than or equal to a given number.

More formally, it returns the largest integer not greater than the argument. For example, asin(-0) is -0 and floor(-0) is -0. 

Here's an example:

```cpp
#include <cmath>
int main() {
    double x = 3.7;
    double y = -4.2;

    double result1 = std::floor(x); // returns 3.0
    double result2 = std::floor(y); // returns -5.0

    return 0;
}
```

Note that `std::floor()` returns a floating-point number (a `double` in this case), even though it represents an integer value.

This function can be very useful when you need to truncate a decimal part of a number and keep only the whole part.

