Here's an example code for a basic multi-laser control system using Arduino Nano:
```c++
const int laser1Pin = 2;  // Pin for laser 1
const int laser2Pin = 3;  // Pin for laser 2
const int laser3Pin = 4;  // Pin for laser 3 (add more as needed)

void setup() {
  pinMode(laser1Pin, OUTPUT);
  pinMode(laser2Pin, OUTPUT);
  pinMode(laser3Pin, OUTPUT);  // Add more as needed
}

void loop() {
  // Pattern 1: Blinking lasers in sequence
  digitalWrite(laser1Pin, HIGH);
  delay(500);
  digitalWrite(laser1Pin, LOW);
  delay(500);

  digitalWrite(laser2Pin, HIGH);
  delay(500);
  digitalWrite(laser2Pin, LOW);
  delay(500);

  digitalWrite(laser3Pin, HIGH);
  delay(500);
  digitalWrite(laser3Pin, LOW);
  delay(500);

  // Pattern 2: Alternate between two lasers
  while (true) {
    digitalWrite(laser1Pin, HIGH);
    digitalWrite(laser2Pin, LOW);
    delay(250);

    digitalWrite(laser1Pin, LOW);
    digitalWrite(laser2Pin, HIGH);
    delay(250);
  }

  // Pattern 3: Rotate through all lasers
  while (true) {
    digitalWrite(laser1Pin, HIGH);
    digitalWrite(laser2Pin, LOW);
    digitalWrite(laser3Pin, LOW);
    delay(500);

    digitalWrite(laser1Pin, LOW);
    digitalWrite(laser2Pin, HIGH);
    digitalWrite(laser3Pin, LOW);
    delay(500);

    digitalWrite(laser1Pin, LOW);
    digitalWrite(laser2Pin, LOW);
    digitalWrite(laser3Pin, HIGH);
    delay(500);
  }
}
```
Feel free to modify this code to suit your specific needs, such as changing the pin numbers, adjusting the delay times, or adding more patterns.

Remember to connect the corresponding pins on the Arduino Nano to the laser modules (usually via transistors or switching ICs). Make sure to also connect the power supply and any necessary resistors or capacitors according to the laser module's datasheet.

