```c
#include <x86intrin.h>

int main() {
    // assume 'a' and 'b' are float arrays with at least 1024 elements each

    __m256 va, vb;
    int i;

    for (i = 0; i < 1024; i += 8) {
        va = _mm256_loadu_ps(&a[i]);
        vb = _mm256_loadu_ps(&b[i]);

        va = _mm256_add_ps(va, _mm256_add_ps(vb, _mm256_set1_ps(1.0f)));

        _mm256_storeu_ps(&a[i], va);
    }

    return 0;
}
```

This code uses AVX (Advanced Vector Extensions) instructions to load 8 `float` values from arrays `a` and `b`, add them together element-wise with an additional 1.0f, and store the results back into array `a`. 

Please note that:
1. The code assumes that the size of arrays `a` and `b` are multiples of the vector length (8 in this case). If they aren't, you would need to handle the remaining elements separately.
2. This code may require specific compiler options (like `-mavx`) to work correctly.
3. You should consult the Intel documentation or other reliable sources for a more thorough understanding of these intrinsics.

Keep in mind that for such a small operation, the vectorization might not provide significant performance gains due to overheads like loading/storing data and loop management. For more complex operations or larger datasets, vectorization can be much more beneficial.

